import { useHistory } from "react-router-dom";
const Helicopter = () => {
    const history = useHistory();
    return(
        <div className="helicopter">
            <h1 font={24} style={{marginTop:"-15rem"}}>Elicopterele</h1>
            <div className="position-absolute  start-50 translate-middle" style={{marginTop:"2rem",textAlign:"justify", fontFamily:"", color:"white"}} >
                <h2 style={{marginTop:"4rem"}}>De unde a venit ideea de elicopter?</h2>
            </div>
        </div>
    );
}
export default Helicopter;
